reformat_rules_join:
joins = [
  {
    "fmt": "table",
    "src": "orx_idw_dm_prd.d_carrier",
    "join-cond": "in1.carrier_id = in0.anaacd",
    "val-cols": [
      "in1.carrier_sk as in1_carrier_sk"
    ]
  },
  {
    "fmt": "table",
    "src": "orx_idw_dm_prd.d_carrier",
    "join-cond": "in1.carrier_id = CASE WHEN isNullOrBlank(anaacd) THEN '-' ELSE anaacd END",
    "val-cols": [
      "in1.carrier_nm AS carrier_nm0"
    ]
  },
  {
    "fmt": "query",
    "src": "select carrier_id ,carrier_nm, acct_id ,acct_nm , update_ts from (select carrier_id , acct_id , carrier_nm , acct_nm,update_ts , row_number() over ( partition by carrier_id , acct_id order by benft_record_mon desc,update_ts desc ) rank from orx_idw_rxmax_prd.F_BENFT_FILE_EXTND where carrier_nm <> 'NULL' and acct_nm<>'NULL') F_BENFT_FILE_EXTND where rank =1;",
    "join-cond": "in1.carrier_id = in0.anaacd AND in1.acct_id = in0.anaccd",
    "val-cols": [
      "in1.carrier_nm AS carrier_nm1",
      "in1.acct_nm AS acct_nm1"
    ]
  },
  {
    "fmt": "table",
    "src": "orx_idw_dm_prd.l_client_account_hierarchy",
    "join-cond": "in1.carrier_id = in0.anaacd AND in1.account_id = in0.anaccd",
    "val-cols": [
      "in1.acct_client_type_id AS acct_client_type_id2",
      "in1.acct_client_type_desc AS acct_client_type_desc2",
      "in1.acct_product_type_id AS acct_product_type_id2",
      "in1.acct_product_type_desc AS acct_product_type_desc2",
      "in1.acct_product_line_id AS acct_product_line_id2",
      "in1.acct_product_line_desc AS acct_product_line_desc2"
    ]
  }
]

